// @mui material components

import SuiTypography from "components/SuiTypography";
// import { Link } from 'react-router-dom';
// Soft UI Dashboard PRO React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";
import { Button, Col, Form, Table } from 'react-bootstrap';



function Cams() {
    return (
        <DashboardLayout>
            <DashboardNavbar />

            <br />

            <SuiTypography variant="h2" fontWeight="medium" style={{ textAlign: 'center', color: 'green' }}>
                Download SOA (0)
            </SuiTypography>

            <br />
            <hr style={{ color: 'red' }} />

            <br />

            <Table striped bordered hover size="sm" style={{ textAlign: "center" }}>

                <thead>

                    <tr>

                        <th style={{ padding: '15px', backgroundColor: "#038d8a" }}>User Id</th>

                        <th style={{ padding: '15px', backgroundColor: "#038d8a" }}>User</th>


                        <th style={{ padding: '15px', backgroundColor: "#038d8a" }}>Holding Id</th>

                        <th style={{ padding: '15px', backgroundColor: "#038d8a" }}>Submitted On</th>

                        <th style={{ padding: '15px', backgroundColor: "#038d8a" }}>Link</th>


                    </tr>

                </thead>

            </Table>

            <br />

            <Form style={{ fontWeight: 'bold' }}>

                <Button as={Col} variant="" type="submit" style={{ fontWeight: 'bold', padding: '10px', width: '200px', margin: '5px' }}>
                    previous
                </Button>

                <Button as={Col} variant="" type="submit" style={{ fontWeight: 'bold', padding: '10px', width: '200px' }}>
                    next
                </Button>
            </Form>

            <Footer />

        </DashboardLayout>
    );
}

export default Cams;
